const html = require('choo/html')

const cats = [
  'data:image/png;base64,',
  'data:image/png;base64,',
  'data:image/png;base64,',
  'data:image/png;base64,'
]

module.exports = function (state, prev, send) {
  const archive = state.archive
  const peers = archive.peers

  function createPeer (peer, i) {
    let want = 0
    let have = 0
    const feed = archive.feeds.filter(function (feed) {
      return feed.name === 'content'
    })
    if (!feed.length) return
    peer.blocks.map(function (block) {
      if (block) have++
      return
    })
    if (feed[0].blocks) want = feed[0].blocks.length
    return html`
      <div class="friend">
        <div class="dat-progress-circle" style="animation-delay: ${-(100 * have / want)}s">
          <div class="dat-progress-circle__avatar">
            <img src="${cats[i]}" />
          </div>
        </div>
      </div>
    `
  }

  return html`
    <section class="section">
      ${peers.map(function (peer, i) {
        return createPeer(peer, i)
      })}
    </section>
  `
}
